import React from "react";
import API from "../utils/booksapi";

export default function BookSearch() {
  const getParam = () => {
    var param = { search: document.getElementById("search").value };
    console.log(param);
    searchBook(param);
  };

  const searchBook = (data) => {
    console.log(data);
    API.getBooks(data)
      .then((res) => {
        console.log();
        console.log(res.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  return (
    <div>
      <input type="text" id="search" placeholder="Title or Author"></input>
      <button onClick={getParam}>Search</button>
    </div>
  );
}
